void Editor::timerCallback() {

    static int lastState = -1;
    int state = momentaryRadioButton->getState();

    if (state != lastState) {
        auto& repeat = processor.repeat;
        for (int i = 0; i < repeat.size(); i++) {
            if (state == -1) repeat[i].setInterval(0);
            else if (state == 0) repeat[i].setInterval(1);
            else if (state == 1) repeat[i].setInterval(2);
            else if (state == 2) repeat[i].setInterval(4);
            else if (state == 3) repeat[i].setInterval(8);
            else if (state == 4) repeat[i].setInterval(16);
        }
    }

    lastState = state;
}

